// client/src/components/ProposalForm.js
import React, { useState } from 'react';
import axios from 'axios';

const ProposalForm = () => {
  const [formData, setFormData] = useState({
    clientInfo: ['', '', '', '', ''],
    projectDetails: ['', '', ''],
    hourlyRate: '',
    generatePDF: false,
  });
  const [proposal, setProposal] = useState('');

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log('Form data submitted:', formData);
    try {
      const response = await axios.post('/api/generate/proposal', formData);
      console.log('Response from backend:', response.data);
      if (formData.generatePDF) {
        const url = window.URL.createObjectURL(new Blob([response.data], { type: 'application/pdf' }));
        const link = document.createElement('a');
        link.href = url;
        link.setAttribute('download', 'proposal.pdf');
        document.body.appendChild(link);
        link.click();
        link.parentNode.removeChild(link);
      } else {
        setProposal(response.data.proposal);
      }
    } catch (error) {
      console.error('Error generating proposal:', error);
      alert(`Failed to generate proposal: ${error.response.data.details}`);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <h2>Client Information</h2>
        {['Name', 'Industry', 'Company Size', 'Contact Information', 'Primary Contact Person'].map((field, idx) => (
          <div key={idx}>
            <label>{field}</label>
            <input
              type="text"
              name={`clientInfo.${idx}`}
              value={formData.clientInfo[idx]}
              onChange={(e) => {
                const newClientInfo = [...formData.clientInfo];
                newClientInfo[idx] = e.target.value;
                setFormData({ ...formData, clientInfo: newClientInfo });
              }}
            />
          </div>
        ))}
      </div>
      <div>
        <h2>Project Details</h2>
        {['Goal', 'Problems or Needs', 'Importance'].map((field, idx) => (
          <div key={idx}>
            <label>{field}</label>
            <input
              type="text"
              name={`projectDetails.${idx}`}
              value={formData.projectDetails[idx]}
              onChange={(e) => {
                const newProjectDetails = [...formData.projectDetails];
                newProjectDetails[idx] = e.target.value;
                setFormData({ ...formData, projectDetails: newProjectDetails });
              }}
            />
          </div>
        ))}
      </div>
      <div>
        <h2>Pricing and Costs</h2>
        <div>
          <label>Predefined Hourly Rate (NOK)</label>
          <input
            type="text"
            name="hourlyRate"
            value={formData.hourlyRate}
            onChange={handleChange}
          />
        </div>
      </div>
      <div>
        <label>
          <input
            type="checkbox"
            name="generatePDF"
            checked={formData.generatePDF}
            onChange={handleChange}
          />
          Generate PDF
        </label>
      </div>
      <button type="submit">Generate Proposal</button>
      {proposal && (
        <div>
          <h2>Generated Proposal</h2>
          <pre>{proposal}</pre>
        </div>
      )}
    </form>
  );
};

export default ProposalForm;
